import React from 'react'
import csclublogo from '../Files/csclub_logo.png';
import { Tab } from "../Components/Tab"
import gray_gradient from '../Files/gradient1.svg'
import {
    NavLink
  } from 'react-router-dom';



function Header (props){

    const tabs = props.tabs;
    let tabsArray = [];


    tabs.forEach(element => {
        let modified = element;
        let modlink = '/' + element.toLowerCase();
        console.log(element[0]);
        if (element === props.activeTag){
            modified = "<" + element + "/>";
        }
        tabsArray.push(<Tab clicked={props.clicked}
                                setClicked={props.setClicked} 
                                activeTag={props.activeTag} 
                                setActiveTag={props.setActiveTag} 
                                text={modified}
                                link={modlink}/>);
    });

    // const homeHandler = () => {
    //     props.setActiveTag("")
    //     return <Link to="/"></Link>
    //     //window.location.replace('csclub.rice.edu)
    // };

    const here_we_go =
                    <ul className="flex mr-10">
                        <li>
                            <NavLink to="/" className="main-nav" activeClassName="main-nav-active">Home</NavLink>
                        </li>
                        <li>
                            <NavLink to="/about" className="main-nav" activeClassName="main-nav-active">About</NavLink>
                        </li>
                        <li>
                            <NavLink to="/resources" className="main-nav" activeClassName="main-nav-active">Resources</NavLink>
                        </li>
                        <li>
                            <NavLink to="/events" className="main-nav" activeClassName="main-nav-active">Events</NavLink>
                        </li>
                        <li>
                            <h1 className="text-gray-500 px-4 text-lg font-bold">Subsidiaries</h1>
                        </li>
                        <li>
                            <NavLink to="/contact" className="main-nav" activeClassName="main-nav-active">Contact</NavLink>
                        </li>

                    </ul>

    return (
       <header>
           <div className="flex justify-between items-center py-1">
                <div>
                    <img src={csclublogo} alt="Logo" width="120px" height="120px" className="justify-start px-3 py-6"/>
                </div>
                <img className="flex right-0 absolute" width="90px" src={gray_gradient}/>
                    <ul className="flex mr-10">
                        {here_we_go}
                    </ul>
           </div>
       </header> 
    )
}

export default Header
